function Valores(data, ciudad, tipo) {
    return data.filter(resp => resp.Ciudad == ciudad).map(x => x[tipo])
}

function ValoresMult(data, ciudad, tipo, tipo1) {
    return data.filter(resp => resp.Ciudad == ciudad).map(x => {
        return [x[tipo], x[tipo1]]
    })
}


function valoresUnicos(data, columna) {
    return [...new Set(data.map(item => item[columna]))];
}

